script: |
  super -f text -I q9473.spq | sort > q9473.out

inputs:
  - name: q9473.spq
    data: |
      SELECT DISTINCT + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN - col0 AND col0 AND - col2 + - - ( 62 ) - - 76 IN ( 58 - col2 / ( - col2 * + col0 ) );
  - name: tab2

outputs:
  - name: q9473.out
    data: |
